// dependencies
import { BrowserRouter as Router } from "react-router-dom";

// components
import AnimatedRoutes from "./Components/AnimatedRoutes.js";
import { UserProvider } from './Contexts/usercontext';

function App() {
  return (
    <Router>
      <main className='App'>
        <AnimatedRoutes />
      </main>
    </Router>
  );
}

export default App;
